INSERT INTO `markdowns` (`id`, `doctorId`, `clinicId`, `specialtyId`, `contentHTML`, `contentMarkdown`, `description`, `createdAt`, `updatedAt`) VALUES
(2, 6, NULL, NULL, '<p><strong>Bác sĩ Chuyên khoa II Trần Minh Khuyên</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Trần Minh Khuyên**\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Quá trình đào tạo**\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n**Khám và điều trị**\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', '2022-05-05 18:29:05', '2022-05-06 20:18:57'),
(3, 9, NULL, NULL, '<p><strong>Khám Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội</strong></p>\n<ul>\n<li>Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm.</li>\n<li>Đội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học.</li>\n</ul>\n<p><strong>Đội ngũ bác sĩ</strong></p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Người bệnh nên đặt lịch trước 17 giờ ngày hôm trước để được ưu tiên trong quá trình đi khám.</li>\n<li>Nếu đặt lịch và đi khám trong cùng 1 ngày, thời gian chờ khám có thể kéo dài hơn so với khung giờ đã đăng ký.</li>\n<li>Hiện tại chưa có dịch vụ chọn đích danh bác sĩ thăm khám,người bệnh sẽ được hỗ trợ khám với một trong những bác sĩ dưới đây (tùy thuộc vào lịch khám của bác sĩ trong khung giờ đó):</li>\n</ul>\n<p><strong>Bác sĩ Chuyên khoa II Nguyễn Khắc Lợi</strong></p>\n<ul>\n<li>Giám đốc Bệnh viện chuyên khoa Nam học và Hiếm muộn Hà Nội, Uy viên Ban chấp hành Hội Y học giới tính Việt Nam.</li>\n<li>Nguyên Phó chủ nhiệm khoa Ngoại tiết niệu – Bệnh viện E Hà Nội. Ngoài ra bác sĩ từng công tác tại Bệnh viện Chợ Rẫy, Bệnh viện Thống Nhất thành phố Hồ Chí Minh, Phòng khám Tâm Anh.</li>\n<li>Chứng chỉ đào tạo chuyên ngành Nam khoa tại Cộng hòa Séc (2015),Chứng chỉ đào tạo chuyên ngành Nam khoa tại Vương quốc Bỉ (2018).</li>\n</ul>\n<p><strong>Bác sĩ Phạm Văn Hưởng</strong></p>\n<ul>\n<li>Trưởng khoa Khám bệnh, Bệnh viện Nam học và Hiếm muộn Hà Nội.</li>\n<li>Một trong những bác sỹ chính nhiều kinh nghiệm về Hỗ trợ sinh sản (IVF, IUI)</li>\n<li>Tốt nghiệp Bác sỹ Đa khoa tại Đại học Y Hà Nội (2010). Bác sĩ thường xuyên tham dự các hội nghị Quốc tế tại Châu Âu, Châu Á.</li>\n</ul>\n<p><strong>Thạc sĩ, Bác sĩ Đinh Hữu Việt</strong></p>\n<ul>\n<li>Trưởng khoa Ngoại – Tiết niệu và Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội.</li>\n<li>Tốt nghiệp Bác sỹ Đa khoa tại Đại học Y Thái Nguyên (2009); Tốt nghiệp Thạc sĩ Chuyên ngành Nam khoa và Ngoại Tiết niệu tại Đại học Y Hà Nội.</li>\n<li>Hoàn thành các khóa học về Phẫu thuật tạo hình, thẩm mỹ bộ phận sinh dục nam, nữ tại Đại học Y Hà Nội, Bệnh viện trung ương Quân đội 108, Bệnh viện Xanh pôn (2020).</li>\n</ul>\n<p><strong>Bác sĩ Nguyễn Bá Hưng</strong></p>\n<ul>\n<li>Chuyên gia về Nam học và Y học tình dục với hơn 10 năm kinh nghiệm trong Khám chữa bệnh Nam khoa, Vô sinh – Hiếm muộn.</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa tại Đại học Y Hà Nội (2003). Bác sĩ đã tham gia các khóa học cơ bản, nâng cao về Nam khoa, Y học giới tính, Y học tình dục tại: Thái Lan (2007),Anh Quốc (2012),Bệnh viện Việt Đức (2014),Singapore (2016, 2018)…</li>\n<li>Thành viên các hiệp hội khoa học, tổ chức chuyên môn như: Hội Y học Tình dục Quốc tế và Châu Á Thái Bình Dương (ISSM-APSM),hội sáng kiến châu Á Thái Bình Dương về sinh sản (ASPIRE),hội hỗ trợ sinh sản Hà Nội (HASAR),Hội Nam khoa Hoa Kỳ,…</li>\n</ul>\n<p><strong>Bác sĩ Hà Đức Quang</strong></p>\n<ul>\n<li>Được đào tạo chuyên sâu về Nam học, Y học giới tính.</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội (2016),tốt nghiệp đào tạo Nam khoa, Y học giới tính chuyên sâu tại Trung tâm Nam học Bệnh viện Việt Đức (2018).</li>\n<li>Thành viên hội Y học Giới tính Châu Á Thái Bình Dương, hội Y học Giới tính Thế Giới.</li>\n</ul>\n<p><strong>Bác sĩ Trịnh Kiên Cường</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Y khoa tại Học viện Quân Y (2014).</li>\n<li>Hoàn thành một số chứng chỉ sau đại học về Nam khoa, Y học giới tính (2017).</li>\n<li>Tham gia các khóa tập huấn và hội nghị Quốc tế về Nam khoa, Y học giới tính, Hỗ trợ sinh sản trong và ngoài nước.</li>\n</ul>\n<p><strong>Bác sĩ Nguyễn Anh Tú</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa – Trường Đại học Y Hà Nội;Tốt nghiệp Sĩ quan Quân y – Học viện Quân Y</li>\n<li>Có chứng chỉ đào tại tại Harvard University, Standford University,…</li>\n<li>Tham gia tập huấn, hội nghị, hội thảo của các tổ chức, diễn đàn trong nước và quốc tế về lĩnh vực Nam học, LGBT, Y học giới tính và Hỗ trợ sinh sản</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Rối loạn cương dương</li>\n<li>Rối loạn khoái cảm</li>\n<li>Rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng</li>\n<li>Không quan hệ tình dục được</li>\n<li>Cương cứng liên tục…</li>\n</ul>\n<p><strong>Những dị tật bẩm sinh Hệ sinh sản</strong></p>\n<ul>\n<li>Bất thường về nhiễm sắc thể</li>\n<li>Lưỡng giới</li>\n<li>Tinh hoàn ẩn, lạc chỗ</li>\n<li>Dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…</li>\n</ul>\n<p><strong>Bệnh mắc phải của Hệ sinh sản</strong></p>\n<ul>\n<li>Chấn thương gẫy dương vật</li>\n<li>Xoắn tinh hoàn</li>\n<li>Tràn dịch màng tinh hoàn</li>\n<li>Khối u</li>\n<li>Viêm nhiễm bộ phận sinh dục…</li>\n</ul>\n<p><strong>Chữa giãn tĩnh mạch tinh</strong> – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.</p>\n', '**Khám Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội**\n* Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm.\n* Đội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học.\n\n**Đội ngũ bác sĩ**\n\n**Lưu ý quan trọng**\n\n* Người bệnh nên đặt lịch trước 17 giờ ngày hôm trước để được ưu tiên trong quá trình đi khám.\n* Nếu đặt lịch và đi khám trong cùng 1 ngày, thời gian chờ khám có thể kéo dài hơn so với khung giờ đã đăng ký.\n* Hiện tại chưa có dịch vụ chọn đích danh bác sĩ thăm khám,người bệnh sẽ được hỗ trợ khám với một trong những bác sĩ dưới đây (tùy thuộc vào lịch khám của bác sĩ trong khung giờ đó):\n\n**Bác sĩ Chuyên khoa II Nguyễn Khắc Lợi**\n\n* Giám đốc Bệnh viện chuyên khoa Nam học và Hiếm muộn Hà Nội, Uy viên Ban chấp hành Hội Y học giới tính Việt Nam.\n* Nguyên Phó chủ nhiệm khoa Ngoại tiết niệu – Bệnh viện E Hà Nội. Ngoài ra bác sĩ từng công tác tại Bệnh viện Chợ Rẫy, Bệnh viện Thống Nhất thành phố Hồ Chí Minh, Phòng khám Tâm Anh.\n* Chứng chỉ đào tạo chuyên ngành Nam khoa tại Cộng hòa Séc (2015),Chứng chỉ đào tạo chuyên ngành Nam khoa tại Vương quốc Bỉ (2018).\n\n**Bác sĩ Phạm Văn Hưởng**\n\n* Trưởng khoa Khám bệnh, Bệnh viện Nam học và Hiếm muộn Hà Nội.\n* Một trong những bác sỹ chính nhiều kinh nghiệm về Hỗ trợ sinh sản (IVF, IUI)\n* Tốt nghiệp Bác sỹ Đa khoa tại Đại học Y Hà Nội (2010). Bác sĩ thường xuyên tham dự các hội nghị Quốc tế tại Châu Âu, Châu Á.\n\n**Thạc sĩ, Bác sĩ Đinh Hữu Việt**\n\n* Trưởng khoa Ngoại – Tiết niệu và Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội.\n* Tốt nghiệp Bác sỹ Đa khoa tại Đại học Y Thái Nguyên (2009); Tốt nghiệp Thạc sĩ Chuyên ngành Nam khoa và Ngoại Tiết niệu tại Đại học Y Hà Nội.\n* Hoàn thành các khóa học về Phẫu thuật tạo hình, thẩm mỹ bộ phận sinh dục nam, nữ tại Đại học Y Hà Nội, Bệnh viện trung ương Quân đội 108, Bệnh viện Xanh pôn (2020).\n\n**Bác sĩ Nguyễn Bá Hưng**\n\n*  Chuyên gia về Nam học và Y học tình dục với hơn 10 năm kinh nghiệm trong Khám chữa bệnh Nam khoa, Vô sinh – Hiếm muộn.\n* Tốt nghiệp Bác sĩ Đa khoa tại Đại học Y Hà Nội (2003). Bác sĩ đã tham gia các khóa học cơ bản, nâng cao về Nam khoa, Y học giới tính, Y học tình dục tại: Thái Lan (2007),Anh Quốc (2012),Bệnh viện Việt Đức (2014),Singapore (2016, 2018)…\n* Thành viên các hiệp hội khoa học, tổ chức chuyên môn như: Hội Y học Tình dục Quốc tế và Châu Á Thái Bình Dương (ISSM-APSM),hội sáng kiến châu Á Thái Bình Dương về sinh sản (ASPIRE),hội hỗ trợ sinh sản Hà Nội (HASAR),Hội Nam khoa Hoa Kỳ,…\n\n**Bác sĩ Hà Đức Quang**\n\n* Được đào tạo chuyên sâu về Nam học, Y học giới tính.\n* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội (2016),tốt nghiệp đào tạo Nam khoa, Y học giới tính chuyên sâu tại Trung tâm Nam học Bệnh viện Việt Đức (2018).\n* Thành viên hội Y học Giới tính Châu Á Thái Bình Dương, hội Y học Giới tính Thế Giới.\n\n**Bác sĩ Trịnh Kiên Cường**\n\n* Tốt nghiệp Bác sĩ Y khoa tại Học viện Quân Y (2014).\n* Hoàn thành một số chứng chỉ sau đại học về Nam khoa, Y học giới tính (2017).\n* Tham gia các khóa tập huấn và hội nghị Quốc tế về Nam khoa, Y học giới tính, Hỗ trợ sinh sản trong và ngoài nước.\n\n**Bác sĩ Nguyễn Anh Tú**\n\n* Tốt nghiệp Bác sĩ Đa khoa – Trường Đại học Y Hà Nội;Tốt nghiệp Sĩ quan Quân y – Học viện Quân Y\n* Có chứng chỉ đào tại tại Harvard University, Standford University,…\n* Tham gia tập huấn, hội nghị, hội thảo của các tổ chức, diễn đàn trong nước và quốc tế về lĩnh vực Nam học, LGBT, Y học giới tính và Hỗ trợ sinh sản\n\n**Khám và điều trị**\n* Rối loạn cương dương\n* Rối loạn khoái cảm\n* Rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng\n* Không quan hệ tình dục được\n* Cương cứng liên tục…\n\n**Những dị tật bẩm sinh Hệ sinh sản**\n\n* Bất thường về nhiễm sắc thể\n* Lưỡng giới\n* Tinh hoàn ẩn, lạc chỗ\n* Dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…\n\n**Bệnh mắc phải của Hệ sinh sản**\n\n* Chấn thương gẫy dương vật\n* Xoắn tinh hoàn\n* Tràn dịch màng tinh hoàn\n* Khối u\n* Viêm nhiễm bộ phận sinh dục…\n\n**Chữa giãn tĩnh mạch tinh** – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.', 'Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm\nĐội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học', '2022-05-05 20:32:51', '2022-05-06 20:39:17'),
(4, 8, NULL, NULL, '<p><strong>Giáo sư, Tiến sĩ, Bác sĩ Đào Văn Long</strong></p>\n<ul>\n<li>Giáo sư, Tiến sĩ, Bác sĩ chuyên ngành Tiêu hóa - Gan mật</li>\n<li>Nguyên Giám đốc bệnh viện Đại Học Y Hà Nội</li>\n<li>Nguyên Tổng thư ký hội khoa học tiêu hóa Việt Nam</li>\n<li>Nguyên Trưởng khoa tiêu hóa Bệnh viện Bạch Mai</li>\n<li>Nguyên Giám đốc Trung tâm Nội soi Bệnh viện Đại học Y Hà Nội</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1983)</li>\n<li>Tốt nghiệp Bác sĩ Nội trú trường Đại học Y Hà Nội (1986)</li>\n<li>Tốt nghiệp tiến sĩ Y khoa (1993)</li>\n<li>Bác sĩ không thăm khám ban đầu, chỉ đọc kết quả</li>\n</ul>\n<p><strong>Lưu ý:</strong> Quy trình sau đây áp dụng khi đi khám chữa bệnh với Giáo sư, Tiến sĩ Đào Văn Long</p>\n<p><strong>Tại Phòng khám Đa khoa Hoàng Long - Tầng 10, Tháp VCCI, Số 9 Đào Duy Anh, Đống Đa, Hà Nội</strong></p>\n<p><strong>Quy trình đi khám bệnh Tiêu hóa với Giáo sư Đào Văn Long</strong></p>\n<ul>\n<li>Bước 1: Bác sĩ chuyên khoa Nội khám và kiểm tra tình trạng chung của người bệnh</li>\n<li>Bước 2: Bác sĩ chuyên khoa Nội chỉ định chụp chiếu, xét nghiệm, nội soi (nếu cần)</li>\n<li>Bước 3: Thực hiện các xét nghiệm, chụp chiếu, nội soi theo chỉ định (nếu có)</li>\n<li>Bước 4: Ngưới bệnh gặp Giáo sư Đào Văn Long để đọc kết quả và phương án điều trị</li>\n</ul>\n<p><strong>Ghi chú:</strong> Bệnh nhân chỉ gặp Giáo sư Đào Văn Long ở Bước 4 (sau khi đã có kết quả xét nghiệm, chụp chiếu, nội soi)</p>\n<p><strong>Bác sĩ chuyên khoa nội thực hiện khám và kiểm tra tình trạng chung cho người bệnh</strong></p>\n<p>Bác sĩ Chuyên khoa II Phạm Thị Lan Hương</p>\n<ul>\n<li>Tốt nghiệp đại học Y khoa Hà Nội (1984)</li>\n<li>Nguyên trưởng khoa tiêu hóa Bệnh Viện E</li>\n</ul>\n<p><strong>Lịch khám bác sĩ Phạm Thị Lan Hương</strong></p>\n<ul>\n<li>Thứ 2 - Thứ 7 hàng tuần</li>\n<li>Sáng: 7h30 - 11h00</li>\n<li>Chiều: 13h30 - 16h00</li>\n</ul>\n<p><strong>Giáo sư điều trị các bệnh lý tiêu hóa</strong></p>\n<p><strong>Chẩn đoán, điều trị các bệnh lý Tiêu hóa</strong></p>\n<ul>\n<li>Giáo sư nhận điều trị các bệnh lý khó về Tiêu hóa, hậu môn, trực tràng, gan mật.</li>\n<li>Chẩn đoán và điều trị các bệnh về dạ dày, tá tràng</li>\n<li>Chẩn đoán và điều trị các bệnh về đại, trực tràng</li>\n<li>Polyp dạ dày – tá tràng, đại tràng</li>\n<li>Dị vật đường tiêu hóa</li>\n<li>Chẩn đoán, điều trị u dưới niêm mạc dạ dày – tá tràng, đại tràng</li>\n<li>Chẩn đoán, điều trị ung thư sớm đường tiêu hóa</li>\n<li>Lấy sinh thiết</li>\n<li>Đau dạ dày</li>\n<li>Chảy máu dạ dày</li>\n<li>Đau thượng vị</li>\n<li>Viêm dạ dày</li>\n<li>Loét dạ dày tá tràng</li>\n<li>Nhiễm Helicobacter pylori dạ dày (HP)</li>\n<li>Trào ngược dạ dày thực quản (Gerd)</li>\n<li>Tắc ruột</li>\n<li>Polyp dạ dày</li>\n<li>Chảy máu dạ dày</li>\n<li>Viêm dạ dày ruột Virus</li>\n<li>Viêm ruột thừa</li>\n<li>Polyp dạ dày</li>\n<li>Ung thư dạ dày</li>\n<li>Táo bón</li>\n<li>Khó nuốt</li>\n<li>Khó tiêu</li>\n<li>Ợ nóng, Ợ chua</li>\n<li>Táo bón</li>\n</ul>\n<p><strong>Bệnh lý đại tràng, trực tràng, hậu môn</strong></p>\n<ul>\n<li>Hội chứng ruột kích thích (viêm đại tràng co thắt)</li>\n<li>Viêm đại tràng</li>\n<li>Viêm đại tràng màng giả</li>\n<li>Viêm loét đại tràng</li>\n<li>Bệnh trĩ, trĩ chảy máu, rò hậu môn</li>\n<li>Rò hậu môn, ngứa hậu môn</li>\n<li>Đại tiện ra máu, đại tiện khó</li>\n<li>Apxe hậu môn</li>\n<li>Đi ngoài ra máu</li>\n</ul>\n<p><strong>Bệnh về Gan mật</strong></p>\n<ul>\n<li>Chẩn đoán và điều trị các bệnh lý về gan</li>\n<li>Bệnh Viêm gan B, viêm gan C</li>\n<li>Xơ gan, ung thư ga</li>\n<li>Viêm gan do thuốc, nhiễm độc…</li>\n</ul>\n', '**Giáo sư, Tiến sĩ, Bác sĩ Đào Văn Long**\n* Giáo sư, Tiến sĩ, Bác sĩ chuyên ngành Tiêu hóa - Gan mật\n* Nguyên Giám đốc bệnh viện Đại Học Y Hà Nội\n* Nguyên Tổng thư ký hội khoa học tiêu hóa Việt Nam\n* Nguyên Trưởng khoa tiêu hóa Bệnh viện Bạch Mai\n* Nguyên Giám đốc Trung tâm Nội soi Bệnh viện Đại học Y Hà Nội\n* Tốt nghiệp Đại học Y Hà Nội (1983)\n* Tốt nghiệp Bác sĩ Nội trú trường Đại học Y Hà Nội (1986)\n* Tốt nghiệp tiến sĩ Y khoa (1993)\n* Bác sĩ không thăm khám ban đầu, chỉ đọc kết quả\n\n**Lưu ý:** Quy trình sau đây áp dụng khi đi khám chữa bệnh với Giáo sư, Tiến sĩ Đào Văn Long\n\n**Tại Phòng khám Đa khoa Hoàng Long - Tầng 10, Tháp VCCI, Số 9 Đào Duy Anh, Đống Đa, Hà Nội**\n\n**Quy trình đi khám bệnh Tiêu hóa với Giáo sư Đào Văn Long**\n* Bước 1: Bác sĩ chuyên khoa Nội khám và kiểm tra tình trạng chung của người bệnh\n* Bước 2: Bác sĩ chuyên khoa Nội chỉ định chụp chiếu, xét nghiệm, nội soi (nếu cần)\n* Bước 3: Thực hiện các xét nghiệm, chụp chiếu, nội soi theo chỉ định (nếu có)\n* Bước 4: Ngưới bệnh gặp Giáo sư Đào Văn Long để đọc kết quả và phương án điều trị\n\n**Ghi chú:** Bệnh nhân chỉ gặp Giáo sư Đào Văn Long ở Bước 4 (sau khi đã có kết quả xét nghiệm, chụp chiếu, nội soi)\n\n**Bác sĩ chuyên khoa nội thực hiện khám và kiểm tra tình trạng chung cho người bệnh**\n\nBác sĩ Chuyên khoa II Phạm Thị Lan Hương\n\n* Tốt nghiệp đại học Y khoa Hà Nội (1984)\n* Nguyên trưởng khoa tiêu hóa Bệnh Viện E\n\n**Lịch khám bác sĩ Phạm Thị Lan Hương**\n\n* Thứ 2 - Thứ 7 hàng tuần\n* Sáng: 7h30 - 11h00\n* Chiều: 13h30 - 16h00\n\n**Giáo sư điều trị các bệnh lý tiêu hóa**\n\n**Chẩn đoán, điều trị các bệnh lý Tiêu hóa**\n\n* Giáo sư nhận điều trị các bệnh lý khó về Tiêu hóa, hậu môn, trực tràng, gan mật.\n* Chẩn đoán và điều trị các bệnh về dạ dày, tá tràng\n* Chẩn đoán và điều trị các bệnh về đại, trực tràng\n* Polyp dạ dày – tá tràng, đại tràng\n* Dị vật đường tiêu hóa\n* Chẩn đoán, điều trị u dưới niêm mạc dạ dày – tá tràng, đại tràng\n* Chẩn đoán, điều trị ung thư sớm đường tiêu hóa\n* Lấy sinh thiết\n* Đau dạ dày\n* Chảy máu dạ dày \n* Đau thượng vị \n* Viêm dạ dày\n* Loét dạ dày tá tràng\n* Nhiễm Helicobacter pylori dạ dày (HP)\n* Trào ngược dạ dày thực quản (Gerd)\n* Tắc ruột \n* Polyp dạ dày \n* Chảy máu dạ dày \n* Viêm dạ dày ruột Virus\n* Viêm ruột thừa\n* Polyp dạ dày\n* Ung thư dạ dày\n* Táo bón\n* Khó nuốt\n* Khó tiêu\n* Ợ nóng, Ợ chua\n* Táo bón\n\n**Bệnh lý đại tràng, trực tràng, hậu môn**\n\n* Hội chứng ruột kích thích (viêm đại tràng co thắt)\n* Viêm đại tràng\n* Viêm đại tràng màng giả\n* Viêm loét đại tràng\n* Bệnh trĩ, trĩ chảy máu, rò hậu môn\n* Rò hậu môn, ngứa hậu môn\n* Đại tiện ra máu, đại tiện khó\n* Apxe hậu môn\n* Đi ngoài ra máu\n\n**Bệnh về Gan mật**\n\n* Chẩn đoán và điều trị các bệnh lý về gan\n* Bệnh Viêm gan B, viêm gan C\n* Xơ gan, ung thư ga\n* Viêm gan do thuốc, nhiễm độc…', 'Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Tiêu hóa\nTrên 30 năm kinh nghiệm trong lĩnh vực Tiêu hóa – Gan mật\nBác sĩ không thăm khám ban đầu, chỉ đọc kết quả', '2022-05-25 07:50:17', '2022-05-25 07:51:44');

